import React from 'react';

const OffersAndLink = ({ data }) => {
  if (!data || !data.offers || data.offers.length === 0) {
    return <div>No offers available</div>;
  }

  const { id, sub2, logo, link } = data.offers[0];

  return (
    <div>
      <h2>First Offer</h2>
      <p>Offer ID: {id}</p>
      <p>Sub2: {sub2}</p>
      <p>Logo: <img src={logo} alt="Cherry Gold" /></p>
      <p>Bonuses:</p>
      <p>Link: <a href={link} target="_blank" rel="noopener noreferrer">{link}</a></p>
    </div>
  );
};

export default OffersAndLink;
